export function formatLocation(longitude, latitude) {
    if (typeof longitude === 'string' && typeof latitude === 'string') {
        longitude = parseFloat(longitude);
        latitude = parseFloat(latitude);
    }

    longitude = longitude.toFixed(2);
    latitude = latitude.toFixed(2);

    return {
        longitude: longitude.toString().split('.'),
        latitude: latitude.toString().split('.')
    }
}

export const dateUtils = {
    UNITS: {
        '年': 31557600000,
        '月': 2629800000,
        '天': 86400000,
        '小时': 3600000,
        '分钟': 60000,
        '秒': 1000,
    },
    humanize(milliseconds) {
        let humanize = '';

        for (const key in this.UNITS) {
            if (milliseconds >= this.UNITS[key]) {
                humanize = Math.floor(milliseconds / this.UNITS[key]) + key + '前';
                break;
            }
        }

        return humanize || '刚刚';
    },
    format(dateStr) {
        const date = this.parse(dateStr)
        const diff = Date.now() - date.getTime()

        if (diff < this.UNITS['天']) {
            return this.humanize(diff);
        }

        const _format = function (number) {
            return (number < 10 ? ('0' + number) : number)
        };

        return date.getFullYear() + '/' + _format(date.getMonth() + 1) + '/' + _format(date.getDay()) + '-' +
            _format(date.getHours()) + ':' + _format(date.getMinutes())
    },
    parse(str) { //将"yyyy-mm-dd HH:MM:ss"格式的字符串，转化为一个Date对象
        const a = String(str).split(/[^0-9]/)
        return new Date(a[0], a[1] - 1, a[2], a[3], a[4], a[5])
    },
    formatDateTime(timeStamp) {
        var unixtimestamp = new Date(timeStamp);
        var year = 1900 + unixtimestamp.getYear();
        var month = "0" + (unixtimestamp.getMonth() + 1);
        var date = "0" + unixtimestamp.getDate();
        var hour = "0" + unixtimestamp.getHours();
        var minute = "0" + unixtimestamp.getMinutes();
        var second = "0" + unixtimestamp.getSeconds();
        return /* year + "-" + */month.substring(month.length - 2, month.length) + "/" + date.substring(date.length - 2, date.length)
            + " " + hour.substring(hour.length - 2, hour.length) + ":"
            + minute.substring(minute.length - 2, minute.length)/* + ":"
           + second.substring(second.length-2, second.length) */
    }
};



/**
 * 将 JSON 数据转换成 QueryString
 * @param {Object|Array} object 被转换的JSON数据
 * @param {String} [prefix=''] 键名前缀
 * @return {String}
 */
export function qs(object, prefix = '') {
    if (Array.isArray(object)) {
        if (!prefix) {
            throw new Error('must given a not empty prefix');
        }

        return object.map(function (val) {
            if (val == null) return prefix + '[]=';
            switch(typeof val) {
                case 'boolean':
                    return prefix + '[]=' + (val ? 1 : 0);
                case 'number':
                    return prefix + '[]=' + val;
                case 'object':
                    return qs(val, prefix + '[]');
                default:
                    return prefix + '[]=' + encodeURIComponent(val);
            }
        }).join('&');
    }

    return Object.keys(object).map(function (prop) {
        const value = object[prop];
        const key = prefix ? `${prefix}[${prop}]` : prop;
        if (value == null) return key + '=';
        if (typeof value !== 'object') return key + '=' + encodeURIComponent(value);
        return qs(value, key);
    }).join('&');
}

const simpleColumns = 'id,nickname,avatar,pinyin,gender,description'.split(',');
const fullColumns = 'id,nickname,tel,idcard,avatar,gold,level,pinyin,gender,description'.split(',');
const girl = 'data:image/jpg;base64,';
const boy = 'data:image/jpg;base64,';
const secrecy = 'data:image/jpg;base64,';
const IMG_BASE64_RE = /^data:image\/(jpg|png|jpeg|gif);base64,/;

export function networkImage(url) {
    if (IMG_BASE64_RE.test(url)) return url;
    if (/^\/\//.test(url)) return url;// 网络协议？
    if (/^https?:\/\//.test(url)) return url;
    return config.imgUri + '/' + url.replace(/^\/+/, '');
}

export function normalAvatar({gender, avatar}) {
    if (!avatar) {
        gender = parseInt(gender);
        if (isNaN(gender) || gender === 3) return secrecy;// 3=>保密
        if (gender === 1) return boy;
        if (gender === 2) return girl;
        return secrecy;
    }

    // if (/^\/\//.test(avatar)) {
    //     return 'http:' + avatar;
    // }
    //
    // if (/^https?:\/\//.test(avatar)) {
    //     return avatar;
    // }
    //
    // return config.imgUri + '/' + avatar.replace(/^\/+/, '');
    return networkImage(avatar);
}

