function getMemberInfo(columns, info, fallback) {
    const has = col => hasOwn.call(info, col);

    const result = columns.reduce(function (map, col) {
        if (has('member_' + col)) {
            map[col] = info['member_' + col];
        } else if (has(col)) {
            map[col] = info[col];
        } else if (hasOwn.call(fallback, col)) {
            map[col] = fallback[col];
        }
        return map;
    }, {});

    const gender = parseInt(result.gender);
    result.gender = (isNaN(gender) || gender < 1 || gender > 3) ? 3 : gender;
    result.id = parseInt(result.id);
    result.avatar = normalAvatar(result);

    return result;
}

export function fulledMemberInfo(info, fallback = {}) {
    const result = getMemberInfo(fullColumns, info, fallback);
    result.add_time = info.add_time;// 注册时间
    result.login_times = info.logins || 0;// 登录次数
    return result;
}

export function simpledMemberInfo(info, fallback = {}) {
    return getMemberInfo(simpleColumns, info, fallback);
}

export function normalRoomInfo(info) {
    return {
        id: +info.room_id,// 群聊ID
        name: info.room_name,// 群聊名称
        owner: simpledMemberInfo({
            id: info.room_m_id,// 群主ID
            nickname: info.room_m_name,// 群主昵称
            avatar: info.room_m_avatar,// 群主头像
            gender: info.room_m_gender,// 群主性别
            pinyin: info.room_m_pinyin,// 群主拼音
        }),
        add_time: info.room_time,// 建群时间
        pinyin: info.room_pinyin,// 群聊拼音
        notice: info.room_notice,// 群聊公告
        members: info.members.map(m => simpledMemberInfo(m)),
    };
}